import React from "react";
import { Row, Col, Card, Input, Button } from "react-materialize";
import { useHistory } from "react-router-dom";
import axios from "axios";

const Home = () => {
  const history = useHistory();

  const SubmitLogin = async () => {
    const response = await axios.post(`https://reqres.in/api/login?delay=2`, {
      email: "eve.holt@reqres.in",
      password: "cityslicka",
    });
    if (response.status === 200) {
      console.log(response);
      history.push("/users");
    }
  };

  return (
    <Row>
      <Col m={12} s={12}>
        <h5>Login</h5>
        <Card>
          <Row>
            <Input
              placeholder="lorem@ipsum.com"
              type="email"
              label="Email"
              s={12}
            />
            <Input placeholder="Senha" label="Senha" type="password" s={12} />
            <Col s={12} m={12}>
              <Button
                waves="light"
                className="right grey darken-2"
                onClick={SubmitLogin}
              >
                ENTRAR
              </Button>
            </Col>
          </Row>
        </Card>
      </Col>
    </Row>
  );
};

export default Home;
